import React from 'react';

class NavBar extends React.Component {
    render() { 
        return (
            <nav>
                <h2>Context App</h2>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </nav>
        );
    }
}
 
export default NavBar;
